import React from "react";

function Bike(params) {
    return(
        <>
          <h3>here is the information of bikes</h3>
          <p> I have a bike {params.brand.bikeName} which color is {params.brand.color} and model is {params.brand.model} </p>
        </>
    )
}

export default Bike;
